function run_exercice_code(obj){
    var past_time_max = time_max;

    past_code = obj.slice(0);
    obj = formatExerciceCode(obj);

    updateMaxRange(solution_length(obj));

    todo_step = obj.slice(0);
    past_code_generated = obj.slice(0);

    reset(true);
    example_demo = false;
    var speed = 1-document.querySelector("#speed").value;
    timer_interval = setInterval(__draw,TIME_BETWEEN_INTERVAL*speed);
    invertButtons();
}
function formatExerciceCode(obj,rec){
    if(rec===undefined){    rec = false;    }
    var r_obj = [];
    var tab = (rec)?(obj):(obj.slice(0));

    for(var index in tab){
        var item = tab[index];
        if(item["type"]!="boucle"){
            r_obj.push(item);
            continue;
        }
        var tmp = formatExerciceCode(item["value"],true);
        for(var nb_iter =0;nb_iter<item["nb_iteration"];nb_iter++){
            for(var i=0;i<tmp.length;i++){
                r_obj.push(tmp[i]);
            }
        }
        /*
        for(var i=0;i<item["nb_iteration"];i++){
            var steps_todo = item["value"];
            for(var j=0;j<steps_todo.length;j++){
                var step = steps_todo[j];
                r_obj.push(step);
            }
        }*/
    }
    if(!rec){
        console.log(r_obj);
    }
    return r_obj;
}

